import './BankRates.css'

function BankRates()
{
    const bank_rates = [
        { id: 'b1', bank: 'HDFC', rate: 11.25, },
        { id: 'b2', bank: 'ICICI', rate: 10.99, },
        { id: 'b3', bank: 'State Bank of India', rate: 8.0, },
        { id: 'b4', bank: 'Punjab National Bank', rate: 9.0, },
        { id: 'b5', bank: 'Axis Bank', rate: 10.75, },
      ];

    return(
        <div>
            <div className='box'>
                <div className='item'> {bank_rates[0].bank} </div> 
                <div className='item'> {bank_rates[0].rate} </div> 
            </div>
            <div className='box'>{bank_rates[1].bank} : {bank_rates[1].rate} </div>
            <div className='box'>{bank_rates[2].bank} : {bank_rates[2].rate} </div>
            <div className='box'>{bank_rates[3].bank} : {bank_rates[3].rate} </div>
            <div className='box'>{bank_rates[4].bank} : {bank_rates[4].rate} </div>
        </div>
    );

};

export default BankRates;
